[
  {
    "id": "application_menu_bar",
    "type": "menu_bar",
    "region": "top-bar",
    "components": [
      {
        "id": "menu_arquivo",
        "type": "menu_item",
        "text": "Arquivo",
        "actions": ["onClick"]
      },
      {
        "id": "menu_editar",
        "type": "menu_item",
        "text": "Editar",
        "actions": ["onClick"]
      },
      {
        "id": "menu_exibir",
        "type": "menu_item",
        "text": "Exibir",
        "actions": ["onClick"]
      },
      {
        "id": "menu_inserir",
        "type": "menu_item",
        "text": "Inserir",
        "actions": ["onClick"]
      },
      {
        "id": "menu_formatar",
        "type": "menu_item",
        "text": "Formatar",
        "actions": ["onClick"]
      },
      {
        "id": "menu_estilos",
        "type": "menu_item",
        "text": "Estilos",
        "actions": ["onClick"]
      },
      {
        "id": "menu_tabela",
        "type": "menu_item",
        "text": "Tabela",
        "actions": ["onClick"]
      },
      {
        "id": "menu_formulario",
        "type": "menu_item",
        "text": "Formulário",
        "actions": ["onClick"]
      },
      {
        "id": "menu_ferramentas",
        "type": "menu_item",
        "text": "Ferramentas",
        "actions": ["onClick"]
      },
      {
        "id": "menu_janela",
        "type": "menu_item",
        "text": "Janela",
        "actions": ["onClick"]
      },
      {
        "id": "menu_ajuda",
        "type": "menu_item",
        "text": "Ajuda",
        "actions": ["onClick"]
      }
    ]
  },
  {
    "id": "application_toolbar",
    "type": "toolbar",
    "region": "top-bar",
    "meta": {
      "description": "Main application toolbar with various formatting and editing controls."
    }
  },
  {
    "id": "modal_inserir_tabela",
    "type": "modal",
    "text": "Inserir tabela",
    "region": "main-content",
    "components": [
      {
        "id": "modal_title",
        "type": "label",
        "text": "Inserir tabela",
        "region": "modal-header"
      },
      {
        "id": "modal_close_button",
        "type": "button",
        "text": "X",
        "region": "modal-header",
        "actions": ["onClick"]
      },
      {
        "id": "section_geral",
        "type": "section",
        "text": "Geral",
        "components": [
          {
            "id": "label_nome",
            "type": "label",
            "text": "Nome:"
          },
          {
            "id": "input_nome_tabela",
            "type": "input",
            "text": "tabela1",
            "state": "focused",
            "actions": ["onChange", "onInput"]
          },
          {
            "id": "label_colunas",
            "type": "label",
            "text": "Colunas:"
          },
          {
            "id": "input_colunas",
            "type": "number_input",
            "text": "2",
            "actions": ["onChange", "onIncrement", "onDecrement"]
          },
          {
            "id": "label_linhas",
            "type": "label",
            "text": "Linhas:"
          },
          {
            "id": "input_linhas",
            "type": "number_input",
            "text": "2",
            "actions": ["onChange", "onIncrement", "onDecrement"]
          }
        ]
      },
      {
        "id": "section_opcoes",
        "type": "section",
        "text": "Opções",
        "components": [
          {
            "id": "checkbox_titulo",
            "type": "checkbox",
            "text": "Título",
            "state": "unchecked",
            "actions": ["onClick"]
          },
          {
            "id": "checkbox_repetir_linhas_titulo",
            "type": "checkbox",
            "text": "Repetir linhas de título nas novas páginas",
            "state": "checked",
            "actions": ["onClick"]
          },
          {
            "id": "label_linhas_de_titulo",
            "type": "label",
            "text": "Linhas de título:",
            "state": "disabled",
            "meta": {
              "reason_disabled": "Checkbox 'Título' is unchecked"
            }
          },
          {
            "id": "input_linhas_de_titulo",
            "type": "number_input",
            "text": "1",
            "state": "disabled",
            "actions": ["onChange", "onIncrement", "onDecrement"],
            "meta": {
              "reason_disabled": "Checkbox 'Título' is unchecked"
            }
          },
          {
            "id": "checkbox_nao_dividir_tabela",
            "type": "checkbox",
            "text": "Não dividir tabela entre páginas",
            "state": "unchecked",
            "actions": ["onClick"]
          }
        ]
      },
      {
        "id": "section_estilos",
        "type": "section",
        "text": "Estilos",
        "components": [
          {
            "id": "list_estilos",
            "type": "listbox",
            "state": "active",
            "actions": ["onSelect"],
            "components": [
              {
                "id": "list_item_nenhum",
                "type": "list_item",
                "text": "Nenhum",
                "state": "selected",
                "actions": ["onClick"]
              },
              {
                "id": "list_item_estilo_padrao",
                "type": "list_item",
                "text": "Estilo de tabela Padrão",
                "state": "unselected",
                "actions": ["onClick"]
              },
              {
                "id": "list_item_academico",
                "type": "list_item",
                "text": "Acadêmico",
                "state": "unselected",
                "actions": ["onClick"]
              },
              {
                "id": "list_item_mundo_azul",
                "type": "list_item",
                "text": "Mundo azul",
                "state": "unselected",
                "actions": ["onClick"]
              },
              {
                "id": "list_item_mundo_verde",
                "type": "list_item",
                "text": "Mundo verde",
                "state": "unselected",
                "actions": ["onClick"]
              },
              {
                "id": "list_item_mundo_escarlate",
                "type": "list_item",
                "text": "Mundo escarlate",
                "state": "unselected",
                "actions": ["onClick"]
              },
              {
                "id": "list_item_mundo_alvorada",
                "type": "list_item",
                "text": "Mundo da alvorada",
                "state": "unselected",
                "actions": ["onClick"]
              },
              {
                "id": "list_item_elegante",
                "type": "list_item",
                "text": "Elegante",
                "state": "unselected",
                "actions": ["onClick"]
              }
            ]
          },
          {
            "id": "preview_table_estilos",
            "type": "table",
            "text": "Jan Fev Mar Soma Norte 6 7 8 21 Meio 11 12 13 36 Sul 16 17 18 51 Soma 33 36 39 108",
            "meta": {
              "description": "Preview of the selected table style, showing example data."
            }
          }
        ]
      },
      {
        "id": "button_ajuda",
        "type": "button",
        "text": "Ajuda",
        "region": "modal-footer",
        "actions": ["onClick"]
      },
      {
        "id": "button_inserir",
        "type": "button",
        "text": "Inserir",
        "state": "active",
        "region": "modal-footer",
        "actions": ["onClick"]
      },
      {
        "id": "button_cancelar",
        "type": "button",
        "text": "Cancelar",
        "region": "modal-footer",
        "actions": ["onClick"]
      }
    ]
  },
  {
    "id": "status_bar",
    "type": "status_bar",
    "region": "footer",
    "components": [
      {
        "id": "status_page_info",
        "type": "label",
        "text": "Página 1 de 1"
      },
      {
        "id": "status_word_count",
        "type": "label",
        "text": "0 palavra"
      },
      {
        "id": "status_char_count",
        "type": "label",
        "text": "0 caractere"
      },
      {
        "id": "status_page_style",
        "type": "label",
        "text": "Estilo de página Padrão"
      },
      {
        "id": "status_language",
        "type": "label",
        "text": "Português (Brasil)"
      }
    ]
  }
]
